import { useState } from 'react';
import './App.css';
import data from './data';
import Display from './Display';

function App() {


  function printConsole() {
    data.forEach(function (item) {
      console.log(item.name, item.price, item.pictures, item.seller, item.location, item.rate);

    })
  };


  return (
    <div className="App">
      <ul>
        {data.map((name) =>
        <data key={name.toString()}
              value={name} />
        )}
      </ul>

    </div>
  );
}

export default App;
